import data, { NO_PROJECT } from "../data/data"
import Project from "../components/Project"
import 'bootstrap/dist/css/bootstrap.min.css';
import '../styles/styles.css';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Nav from 'react-bootstrap/Nav';
import Tab from 'react-bootstrap/Tab'
import Tabs from 'react-bootstrap/Tabs'
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import ListGroup from 'react-bootstrap/ListGroup'

const projectType = (project) => {
    if (project == NO_PROJECT) {
        return true
    }
    return false
}
const projects = new Array();
const noprojects = new Array();

(function(){


    Object.keys(data).map ((project, idx) => {
        if (project !== NO_PROJECT) {
            projects.push(project)
                        //<Project key={idx} project={project} notes={data[project]}/>)
                        //console.log("notes: ", data[project]);
        } else {
            noprojects.push(<Project key={idx} project={project} notes={data[project]}/>);
        }
    })
})();

const App = () =>{

    var variants = []
    return ( <ListGroup>
        <ListGroup.Item>Notes Notes Notes EVERYWHERE.</ListGroup.Item>
        { Object.keys(data).map((project,idx) => 
                        <ListGroup.Item variant="info">
                            <Project key={idx} project={project} notes={data[project]}/>
                        </ListGroup.Item>)}
        <ListGroup.Item variant="primary">Primary</ListGroup.Item>
        <ListGroup.Item variant="secondary">Secondary</ListGroup.Item>
        <ListGroup.Item variant="success">Success</ListGroup.Item>
        <ListGroup.Item variant="danger">Danger</ListGroup.Item>
        <ListGroup.Item variant="warning">Warning</ListGroup.Item>
        <ListGroup.Item variant="info">Info</ListGroup.Item>
        <ListGroup.Item variant="light">Light</ListGroup.Item>
        <ListGroup.Item variant="dark">Dark</ListGroup.Item>
      </ListGroup>



    )
}


export default App;
